$('#formLoginPopup').submit(function(event) {
  event.preventDefault();
  var formSubmitLogin = $(this).serialize();

  $.ajax({
    url: "https://90tkp303.com/validate-login", 
    cache: false, 
    success: function(result){
      if (result.r) {
        $.ajax({
          headers: { 'X-CSRF-TOKEN': result.m},
          type: "POST",
          url: "https://90tkp303.com/login",
          data: formSubmitLogin,
          success: function(data) {
            if (data.success){
              if (data.target_casino == "") {
                window.location = 'https://90tkp303.com/dashboard'; 
              }else{
                window.location = 'https://90tkp303.com/dashboard'; 
              };
            }else{
              var message = '';
              $.each(data.message, function(index, element) {
                message = message + '<li>' + element + '</li>';
              });
              $('#login-message-error').html(message);
              $('#login-message-error').show();
              setTimeout(function(){ 
                $('#login-message-error').hide();
                $('.modal-backdrop').hide();
              }, 3000);
            }
          },
          error: function() {
            alert("error");
          }
        });
      } else {
        window.location = '/dashboard';
      }
  }});

});

